class Solution(object):
    def shipWithinDays(self, weights, D):
        """
        :type weights: List[int]
        :type D: int
        :rtype: int
        """
        minVal = max(weights)
        low = -1
        high = -1
        while True:
            d = 0
            w = 0
            temp = -1
            for val in weights:
                if val+w > minVal:
                    if temp == -1:
                        temp = val
                    else:
                        temp = min(temp,val)
                    d += 1
                    w = val
                    if d > D:
                        break
                else:
                    w += val
                if val > 10:
                    pass
            if w > 0:
                d += 1
            if d > D:
                low = minVal
                minVal += val
            else:
                high = minVal
                break
        if low == -1:
            return high
        # print(low,high)
        cacheDict = {low:0,high:1}
        while low<=high:
            minVal = (low+high)//2
            d = 0
            w = 0
            temp = -1
            for val in weights:
                if val+w > minVal:
                    d += 1
                    w = val
                    if d > D:
                        break
                else:
                    w += val
                if val > 10:
                    pass
            if w > 0:
                d += 1
            if d > D:
                cacheDict[minVal] = 0
                low = minVal+1
            else:
                high = minVal

            # print(cacheDict,low,high)
            if low == high == minVal:
                break

        return minVal


